import axios from "axios"
import React from "react"
import { useState, useEffect } from "react"

const Main = () => {
  const data = {
    name: "Grisha",
    numberPhone: "66666",
  }
  async function getData() {
    await fetch("localhost:5000/api/call")
      .then((res) => res.json())
      .then((data) => console.log(data))
  }
  function postData() {
    axios.post("localhost:5000/api/call", data)
  }
  return (
    <main className="main">
      <button  onClick={getData}>
        Отправить
      </button>
    </main>
  )
}

export default Main
